import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import NativeSelect from '@material-ui/core/NativeSelect';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Seventy from '../../pictures/70.png'


const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
      },
    container1: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
        backgroundColor: "white",
        height: '500px',
        margin: '30px',
        borderRadius: '30px',
        boxShadow: "5px 5px 5px"



      },

      container2: {

        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
        backgroundColor: "white",
        height: '200px',
        margin: '50px',
        width: '500px',
        borderRadius: '30px',
        boxShadow: "5px 5px 5px"
      },




  }));

  export default function MainDashboard() {
    const classes = useStyles();


    return (
      <div className = {classes.root}>
          <Grid container>


            <Grid container xs={4} className={classes.container2}>
                <Grid item xs={6}>
                    <h2 >Goods in Transit</h2>
                    <h4> 240 of total 500 </h4>
                </Grid>
                <Grid item xs={6}>
                    <img src={Seventy}  style= {{display: 'block', marginLeft: '50px', marginRight: 'auto', width: '170px'}}/>
                </Grid>
            </Grid>



            <Grid item xs={4}>
            <div className={classes.container2}>xs=12</div>
            </Grid>
            <Grid item xs={4}>
            <div className={classes.container2}>xs=12</div>
            </Grid>

            <Grid item xs={7}>
            <div className={classes.container1}>xs=12</div>
            </Grid>
            <Grid item xs={5}>
            <div className={classes.container1}>xs=6</div>
            </Grid>
            <Grid item xs={7}>
            <div className={classes.container1}>xs=12</div>
            </Grid>
            <Grid item xs={5}>
            <div className={classes.container1}>xs=6</div>
            </Grid>
            <Grid item xs={7}>
            <div className={classes.container1}>xs=12</div>
            </Grid>
            <Grid item xs={5}>
            <div className={classes.container1}>xs=6</div>
            </Grid>
        </Grid>

      </div>
    );
  }
